package com.gdlgxy.internshipcommunity.module.mine;import android.os.Bundle;import android.util.Log;import android.view.LayoutInflater;import android.view.View;import android.view.ViewGroup;import com.gdlgxy.internshipcommunity.base.BaseFragment;import com.gdlgxy.internshipcommunity.databinding.FragmentMineBinding;import com.gdlgxy.navannotationmodule.FragmentDestination;import androidx.annotation.NonNull;import androidx.annotation.Nullable;import androidx.lifecycle.Observer;import androidx.lifecycle.ViewModelProvider;@FragmentDestination(pageUrl = "main/module/mine", asStarter = false)public class MineFragment extends BaseFragment<FragmentMineBinding> {    private MineViewModel mineViewModel;    @Override    public void onViewCreated(@NonNull View view, @Nullable Bundle savedInstanceState) {        super.onViewCreated(view, savedInstanceState);        mineViewModel = new ViewModelProvider(this).get(MineViewModel.class);        mineViewModel.getText().observe(getViewLifecycleOwner(), new Observer<String>() {            @Override            public void onChanged(String s) {                mViewBinding.text.setText(s);            }        });        Log.d("fragment-onViewCreated", "MineFragment");    }    @Override    public void onDestroyView() {        super.onDestroyView();        mineViewModel = null;    }    @Override    public String getPageName() {        return null;    }    @Override    public FragmentMineBinding inflate_Fragment(LayoutInflater layoutInflater, ViewGroup container, boolean at) {        return FragmentMineBinding.inflate(layoutInflater, container, at);    }}